import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';


const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})


const services = `

`.trim();

const searchs = `

  WorkShopData=[
    {name:'test 1', venue:'venue 1', date:new Date(), timing:3, address:'Indore'},
    {name:'user', venue:'305 vijay nagar', date:new Date(), timing:5, address:'Ahmedabad'},
    {name:'Admin', venue:'test venue', date:new Date(), timing:3, address:'Delhi'},
    {name:'user 5', venue:'254561', date:new Date(), timing:3, address:'Bhopal'}
  ]
}


@Pipe({
  name: 'search'
})
export class SearchPipe {
  transform(value: any, args?: any): any {
    if(!args){
      return value;
    }
    return value.filter((val)=>{
      let rVal=(val.name.toLocaleLowerCase().includes(args)) || (val.venue.toLocaleLowerCase().includes(args)) ||
               (val.address.toLocaleLowerCase().includes(args));
      return rVal;
    })
  }
}
`.trim();


class Services extends Component {
  componentDidMount() {
    setTimeout(() => Prism.highlightAll(), 0)
  }
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Grid item xs={2}>
          <Paper className={classes.paper}>
            <h4><Sidebar /></h4>
          </Paper>
        </Grid>
        <Grid item xs={10}>
          <Paper className={classes.paper}>
            <List>
              <h3>Services</h3>
              <div style={titles}>
                <PrismCode
                  code={services}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />

              <h3>Search</h3>
              <div style={titles}>
                <PrismCode
                  code={searchs}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />

              {/* <h3></h3>
              <div style={titles}>
                <PrismCode
                  code={empty}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div> */}
            </List>
          </Paper>
        </Grid>
      </Grid>
    )
  }
}

export default (withStyles(styles)(Services));
